// Expects an object with non-null properties, doesn't handle nulls gracefully
function displayUser(user: { id: string; name: string }): void {
  // Rejects null values for id or name
  if (!user.id || !user.name) {
    throw new Error('User id and name cannot be null')
  }
  console.log(`User ID: ${user.id}, Name: ${user.name}`)
}

